import React from 'react';
import {View, StyleSheet, Text} from 'react-native';

const dummyDishCards = [
    {
        name: 'Pad Kee Mao',
        photo: 'https://thewoksoflife.com/wp-content/uploads/2016/02/drunken-noodles-4.jpg',
        ingredients: "Noodles, Chicken, Sauce, Veggies",
        price: "$12.99"
    },
    {
        name: 'Pad Kee Mao',
        photo: 'https://thewoksoflife.com/wp-content/uploads/2016/02/drunken-noodles-4.jpg',
        ingredients: "Noodles, Chicken, Sauce, Veggies",
        price: "$12.99"
    },
    {
        name: 'Pad Kee Mao',
        photo: 'https://thewoksoflife.com/wp-content/uploads/2016/02/drunken-noodles-4.jpg',
        ingredients: "Noodles, Chicken, Sauce, Veggies",
        price: "$12.99"
    }
];

function DishCard(props) {
    const { name, photo, ingredients, price } = props.data;
    return (
        <View style={styles.container}>
            <Text style={styles.dish}>{name}</Text>
        </View>
    )
}

export default function ChefMenu(props){
    return(
        <View style={styles.container}>
            {dummyDishCards.map((dish, index) => <DishCard data={dish}/>)}
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1
    },
    dish: {
        name: {
            fontSize: 30,
            color: "white",
            fontWeight: 'bold',
            fontFamily: "Verdana"
        },
        photo: {
            fontSize: 50,
            color: "white",
            fontWeight: 'bold',
            fontFamily: "Verdana"
        },
        ingredients: {
            fontSize: 50,
            color: "white",
            fontWeight: 'bold',
            fontFamily: "Verdana"
        },
        price: {
            fontSize: 50,
            color: "white",
            fontWeight: 'bold',
            fontFamily: "Verdana"
        },
    }
});
